import { Component } from "react";
import Admin from "./Admin";
import Icon_Dashboard from "../Icons/Icon_Dashboard";
import Icon_Product from "../Icons/Icon_Product";

class AdminMenu extends Component {
    render() {
        return(
            <div className="sidebar">
                <div className="sidebar__header">
                    Floral Love admin
                </div>

                <div className="sidebar__body">
                    <div className="sidebar__menu">
                        <div className="sidebar__menuHeader">Overview</div>
                        <div className="item"><a href="">{ Icon_Dashboard } Dashboard</a></div>
                        <div className="item"><a href="">{ Icon_Dashboard } Orders</a></div>
                        <div className="item"><a href="">{ Icon_Dashboard } Products</a></div>

                        <div className="sidebar__menuHeader">Business</div>
                        <div className="item"><a href="">{ Icon_Dashboard } Analytics</a></div>
                        <div className="item"><a href="">{ Icon_Dashboard } Marketing</a></div>
                        <div className="item"><a href="">{ Icon_Dashboard } Discounts</a></div>
                    </div>
                </div>

                <div className="sidebar__footer">
                    <div className="item"><a href="">{ Icon_Dashboard } Log Out</a></div>
                    <div className="item"><a href="">{ Icon_Dashboard } Settings</a></div>
                </div>
            </div>
        )
    }
}

export default AdminMenu
